import styled from "styled-components";
import MainSecTitleCarousel from "./MainSecTitleCarousel"
import CarouselImgs from "./MainSecCarousel"
import { GlobalSection } from "../../stylesGlobal";

GlobalSection = styled(GlobalSection)`
    width: 100%;
    margin: 0 auto;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
`


const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: relative;
`;

function Section05() {
    return (
        <SectionCTA>
            <MainSecTitleCarousel />
            <CarouselImgs />
        </SectionCTA>
    )
};

export default Section05;
